import Button from './Button';
import PropTypes from 'prop-types';

function App(){
    return (
        <div>
            <div>
                <Button success primary>Click Here!</Button>
            </div>
            <div>
                <Button>Buy Now!</Button>
            </div>
            <div>
                <Button>See Deal!</Button>
            </div>
            <div>
                <Button>Hide Ads!</Button>
            </div>
            <div>
                <Button>Something!</Button>
            </div>
        </div>
    );
}

export default App;
